import React from 'react';
import IconButton from '@mui/material/IconButton';
import Button from '@mui/material/Button';
import './App.css';
import AcUnitIcon from '@mui/icons-material/AcUnit';
import AirplanemodeActiveIcon from '@mui/icons-material/AirplanemodeActive';
import AlarmIcon from '@mui/icons-material/Alarm';
import ButtonGroup from '@mui/material/ButtonGroup';
function App() {
  return (
    <div className="App">
      <Button variant="text" color="primary" size="large">Text</Button>
      <Button variant="contained" startIcon={<AcUnitIcon />} color="secondary">Contained</Button>
      <Button variant="outlined" color="success" endIcon={<AirplanemodeActiveIcon/>}  size="small">Outlined</Button>
      <IconButton color="warning" aria-label="add an alarm">
  <AlarmIcon />
</IconButton>
      <br>
      </br>
      <ButtonGroup variant="contained" aria-label="outlined primary button group">
      <Button>One</Button>
      <Button>Two</Button>
      <Button>Three</Button>
    </ButtonGroup>

    <ButtonGroup orientation='vertical' variant="contained" aria-label="outlined primary button group">
      <Button>One</Button>
      <Button>Two</Button>
      <Button>Three</Button>
    </ButtonGroup>
    </div>
  );
}

export default App;
